var app=new Vue({el:"#app",data:{m:{},Errors:{},dismissSecs:10,dismissCountDown:0,loaded:!1},created:function(){let n=this;axios.get("/Coop/AddFirstImmovablesInit").then(function(t){n.m=t.data;n.loaded=!0}).catch(function(t){n.loaded=!0;n.Errors=t.response.data})},methods:{addFirstImmovables:function(){let n=this;axios.post("/Coop/AddFirstImmovables",n.m).then(function(t){n.m=t.data;n.Errors={};n.dismissCountDown=n.dismissSecs;n.loaded=!0}).catch(function(t){n.loaded=!0;n.Errors=t.response.data})},validationState:function(n){return this.loaded?this.Errors[n]===undefined:null},countDownChanged:function(n){this.dismissCountDown=n},onDismissed:function(){this.dismissCountDown=0;window.location.href="/Coop/PleasePayEntranceFeeToProceed"}}});